import { UserService } from '../user/UserService'
import { IContentSearchRequest } from '../user/types/SearchUserRequest';
import { UserRole } from '../../shared/enums/UserRole';
const { Column, ColumnGroup } = Table;

interface Item {
  username: string; 
  firstName: string;
  lastName: string; 
  email: string;
  status: string;
}

const EditableCell = ({
  editing,
  dataIndex,
  title,
  inputType,
  record,
  index,
  children,
  ...restProps
}: any) => {
  const inputNode = inputType === 'number' ? <InputNumber /> : <Input />;

  return (
    <td {...restProps}>
      {editing ? (
        <Form.Item
          name={dataIndex}
          style={{ margin: 0 }}
          rules={[
            {
              required: true,
              message: `Please Input ${title}!`,
            },
          ]}
        >
          {inputNode}
        </Form.Item>
      ) : (
        children
      )}
    </td>
  );
};

